import React from 'react';
import abstractImg from '../../assets/abstract.jpg';
import PropTypes from 'prop-types';
import './Image.css';

function Image({ img }) {
  return <img className="card-img" src={img} alt="" />;
}

Image.propTypes = {
  img: PropTypes.string.isRequired,
};

export default Image;
